pragma solidity ^ 0.4.25;

import './Interfaces.sol';
import './Helpers.sol';
import './Libs.sol';
import './Enums.sol';


contract Repository is IRepository, Shared, 
    UsingEnums, 
    UsingSettings {

    using SafeMath for uint256;

    struct _Currency {
        string name;
        address tokenAddress; //if currencytype = TOKEN
    }

    mapping(uint256 => _Currency) currencies; //currencyType -> currency

    function initialize(address _fodrAddress, address _warcAddress) public __onlyOwner {
        require(currencies[2].tokenAddress == address(0));
        
        currencies[1].name = "Avax";

        currencies[2].name = "FODR";
        currencies[2].tokenAddress = _fodrAddress;

        currencies[3].name = "WARC";
        currencies[3].tokenAddress = _warcAddress;
    }

    function getBalance(uint256 _currency) public view returns(uint256) {
        if(_currency == uint256(CurrencyType.AVAX)) {
            return address(this).balance;
        }

        IStandardToken nft = IStandardToken(currencies[_currency].tokenAddress);
        return nft.balanceOf(address(this));
    }

    function getTokenBalanceOf(address _to, uint256 _currency) public view returns(uint256) {
        IStandardToken nft = IStandardToken(currencies[_currency].tokenAddress);
        return nft.balanceOf(_to);
    }

    function getTokenAllowance(address _owner, uint256 _currency) public view returns(uint256) {
        IStandardToken nft = IStandardToken(currencies[_currency].tokenAddress);
        return nft.allowance(_owner, address(this));
    }

    function isExistsCurrency(uint256 _currency) public view returns(bool) {
        return _currency == 1 || _currency == 2 || _currency == 3;
    }

    //##############################################################################

    function withdrawAvax(address _to, uint256 _amount) __onlyShared public {
        //TODO: required mutex
        _to.transfer(_amount);
    }

    function withdrawToken(address _to, uint256 _currency, uint256 _amount) __onlyShared public {
        require((currencies[_currency].tokenAddress).call(bytes4(keccak256("transfer(address,uint256)")),
                _to, _amount));
    }

    //not: approve before call it.
    function depositToken(address _from, uint256 _currency, uint256 _amount) __onlyShared public {
        require((currencies[_currency].tokenAddress).call(bytes4(keccak256("transferFrom(address,address,uint256)")),
            _from, address(this), _amount));
    }

    //not: approve before call it.
    function transferFrom(address _from, address _to, uint256 _currency, uint256 _amount) __onlyShared public {
        require((currencies[_currency].tokenAddress).call(bytes4(keccak256("transferFrom(address,address,uint256)")),
            _from, _to, _amount));
    }

    function mintFodr(address _to, uint256 _amount) __onlyShared public {
        require((currencies[2].tokenAddress).call(bytes4(keccak256("mint(address,uint256)")),
            _to, _amount));
    }

    function burnFodr(address _from, uint256 _amount) __onlyShared public {
        require((currencies[2].tokenAddress).call(bytes4(keccak256("burn(address,uint256)")),
            _from, _amount));
    }

    function() external payable {}
    
}
